 @imperadoraurelianus5325  , mais o Mano já ganhou títulos importantes , como CdB e por detalhes não ganhou outros , já treinou a seleção brasileira principal : vc não acha que um cara desses não merece p menos uns 2 anos de sequência ? Pô a Abelão foi vice brasileiro com o Inter sendo roubado , e não deram sequência no trabalho do homem .
Prá mim o ÚNICO motivo de demissão é se o time tiver no Z4 e não tiver conseguindo sair , porque todos sabem que segunda divisão é um prejuízo financeiro enorme , fora isso eu acho que treinadores do nível do Abelão e Mano Menezes , tem que ter sequência de trabalho.
No caso do Palmeiras o 💸e a sorte  ajudaram o portuga , mais isso é um ponto fora da curva

 @NiFeRe.  Eu li oq? Goleada? 😂🤣🤣🤣

5 minutos do 1° tempo, o juiz aprontou contra o Botafogo o maior combo de injustiça do ano:

1) Marcou um pênalti escandaloso pro inter;
2) Expulsou o jogador do Botafogo;
3) Expulsou o técnico do Botafogo.

Ou seja, num lance, detonou 3 vezes o Botafogo.

Expulsão injusta - Pênalti injusto - perdendo de 2x0 - no Beira-Rio - 4 consultas ao VAR à favor do Inter - Arbitragem roubado descaradamente - viraram o jogo com 1 a menos.

Botafogo o primeiro Clube a ganhar de 3 adversários diferentes: o Inter, o juiz e o Var.

E detalhe, no mesmo jogo kkkkkkkk

A camisa pesa, PORRA!

